  \"2013-03-15T23:05:24.008270\",\n\t\"name\": \"bedrock-geology-of-the-woodstock-quadrangle-vermont\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This resource is available as a downloadable
  file, ESRI Service, and as a Web Feature service. Resource includes a Bedrock map,
  Tectonic map, and text on Bedrock geology for the Woodstock Quadrangle, Vermont.
  For more information see links provided. Abstract: The Woodstock quadrangle, in
  east-central Vermont, lies partly on the eastern limb of the Green Mountain anticlinorium
  and partly in the region of domes and recumbent folds of eastern Vermont. The oldest
  rocks belong to the Precambrian Mount Holly complex and are exposed in the extreme
  southwest corner of the area. These are overlain eastward by younger strata. They
  include the Tyson, Hoosac and Pinnev Hollow formations at the base and the Gile
  Mountain, Standing Pond and Waits River formations at the top. Twelve major units
  as well as certain of their subdivisions have been mapped. These rocks range in
  probable age from lowest Cambrian to Devonian and have a total thickness of more
  than 20,000 feet. Nearly the entire eastern Vermont sequence is thus exposed in
  the quadrangle.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
